import React from "react";
import { Grid } from "@material-ui/core";
function FormulaBar() {
  return (
    <Grid container direction="row">
      <Grid item xs={12} sm={9}>
        Fx:
      </Grid>
      <Grid item xs={12} sm={9} justifyContent="flex-end">
        {" "}
        Expand Formula
      </Grid>
    </Grid>
  );
}

export default FormulaBar;
